"use strict";

const { Deque } = require('double-ended-queue');

function f_gold(isWater) {
    const m = isWater.length, n = isWater[0].length;
    const ans = Array.from({ length: m }, () => Array(n).fill(-1));
    const q = new Deque();
    for (let i = 0; i < m; i++) {
        for (let j = 0; j < n; j++) {
            if (isWater[i][j] === 1) {
                ans[i][j] = 0;
                q.push([i, j]);
            }
        }
    }
    while (q.length > 0) {
        const [i, j] = q.shift();
        for (const [a, b] of [[0, -1], [0, 1], [1, 0], [-1, 0]]) {
            const x = i + a, y = j + b;
            if (0 <= x && x < m && 0 <= y && y < n && ans[x][y] === -1) {
                ans[x][y] = ans[i][j] + 1;
                q.push([x, y]);
            }
        }
    }
    return ans;
}
